import{_ as p}from"./plugin-vue_export-helper-c27b6911.js";import{o as _,c as e,e as t}from"./app-f05d3ed8.js";const o={},c=t("<p>《三命通会》卷 九·六癸日乙卯时断</p><p>六癸日生乙卯时，长生之地遇食神；众无午酉兼辛巳，福寿双全禄位人。</p><p>癸日乙卯时，食神干旺。</p><p>癸以乙为学堂食神，卯上癸水长生，乙坐禄，柱中无己破辛夺，午酉刑冲，通月气，有倚托，主聪明有寿，居官食禄；若有己土，不贵。</p><p>春月生，北运，显达。</p><p>癸丑日乙卯时，辰丑月，高贵。</p><p>一云：少贱中年贵。</p><p>癸卯日乙卯时，艰难。</p><p>生寅卯月，伤官格，难言富贵。</p><p>未戌年月，技艺近贵。</p><p>辰丑，吉。</p><p>己丑、丙子，凶。</p><p>癸巳日乙卯时，财官双美，春伤官，夏财旺，秋印稳，冬平常。</p><p>如丑午子亥年月，官至三四品。</p><p>乙亥、乙酉，残疾。</p><p>癸未日乙卯时，寅亥卯未月，伤官伤尽，刚断平常。</p><p>辰戌申子月，贵。</p><p>癸酉日乙卯时，申子辰月，贵。</p><p>寅午戌，中。</p><p>亥卯未，平。</p><p>巳酉丑，富。</p><p>癸亥日乙卯时，辰己月，风宪。</p><p>乙癸相逢旺食支，天工造物本无私；运行自有高人荐，手攀丹桂上云逵。</p><p>癸日时逢乙卯，贵人食禄之乡，玉堂乙卯位侯王，便是金门将相。</p><p>君子文章播发，常人财禄盈箱，甲寅辛酉颇安常，富贵荣华大享。</p>",25),r=[c];function s(n,a){return _(),e("div",null,r)}const f=p(o,[["render",s],["__file","278卷 九·六癸日乙卯时断.html.vue"]]);export{f as default};
